  [1105406012]="集市帖兑换接引人",
  [1105406013]="这集市帖虽说要<color=#dd0f0f>一千铜钱一张</color>！但除了用来吃喝玩乐以外，还能用来兑换<color=#dd0f0f>集市至宝</color>！！！",
