  [1105406050]="集市帖兑换接引人",
  [1105406051]="什么？！[少侠]竟然集齐了！我这就带[少侠]区间我们掌柜！",
  [1105406052]="弯弯绕绕走了一炷香时间，你来到一座地下宝库……",
  [1105406053]="没想到此次集会至宝这么快就被人兑走了！[少侠]请拿此钥匙打开宝库！这里面的三件至宝全部归你了！",
